import React from 'react';
import Todo from '../Todo/Todo';

function TodoList({ todoList }) {
	return (
		<div>
			{todoList?.map((data) => (
				<div key={data.id}>
					<Todo data={data} />
				</div>
			))}
		</div>
	);
}

export default TodoList;
